import Calculater from "./components/Counter";
import { Provider } from "react-redux";
import { store } from "./store";
import Header from "./components/Header";
import { Auth } from "./components/Auth";
const AppContent = () => {
  <>
    <Header />
    {/* <Calculater /> */}
    <Auth />
  </>;
};

function App() {
  return (
    <Provider store={store}>
      <AppContent />
    </Provider>
  );
}

export default App;
